def make_schedule_dict(s):
	'''
	#schedule = {'MAT223H1F L0201': []
		'CSC207H1F L0101': [],
		'CSC236H1F L0201': [],
		'PHY100H1F L0101': [],
		'PHY100H1F T0301': [],
		'CHM139H1F P0301': [],
		'CSC209H1S L0101': [],
		'CSC343H1S L0201': [],
		'C SC258H1S L0101': [],
		'CSC263H1S L5101': [],
		'ENV200H1S L0101': [],
		'ENV200H1S T0201': [],
		}
	'''
	
	classes = s.split(',')
	schedule = {}
	for cl in classes:
		schedule[cl] = []
	
	return schedule


def find_schedule_times(schedule):
	'''
	schedule = {'MAT223H1F L0201': ['W3' 'F5']
		'CSC207H1F L0101': ['MWF10'],
		'CSC236H1F L0201': ['M1-3', 'R5'],
		'PHY100H1F L0101': ['W6-9'],
		'PHY100H1F T0301': [],
		'CHM139H1F P0301': [],
		'CSC209H1S L0101': [],
		'CSC343H1S L0201': [],
		'CSC258H1S L0101': [],
		'CSC263H1S L5101': [],
		'ENV200H1S L0101': [],
		'ENV200H1S T0201': [],
		}
	'''
	for course in schedule:
		course_code = course.split()
		course_name = course_code[0]
		course_info = time_to_lec[course_name]
		lectut = course_code[1]
		
		my_section_time = course_info[lectut]
		for time in my_section_time:
			hourly_time = split_time(time)
			for x in hourly_time:
				schedule[course].append(x)
	return schedule

def split_time(s):
	'''
	.
	.
	.
	.
	# time = ['M10','W10','F10']
	#or
	# time = ['W6', 'W7', 'W8']
	'''
	return_list = []
	s = s.split('(')
	s = s[0].strip()
	index = 0
	while s[index].isalpha():
		index += 1
	day = s[:index]
	hour = s[index:]
	
	if '-' not in hour:
		for x in day:
			return_list.append(x+hour)
	else:
		hour_split = hour[0]
		hour_end = hour[-1]
		
				
		hour_split = int(hour_split)
		hour_end = int(hour_end)
		
		hourly = ''
		for i in range(hour_split, hour_end):
			hourly = hourly + str(i)
		
		for x in day:
			for h in hourly:
				return_list.append(x+h)
	
	return return_list

def compare_times(schedule):
	matched_courses = []
	for course in schedule:
		cl = course.split()
		cl = cl[0]
		sem = cl[-1]
		for time in schedule[course]:
			matches = search(time[0], time[1:], sem)
			for x in matches:
				matched_courses.append(x)
	'''
	.
	.
	.
	.
	# matched_courses = ['SOC101Y1 LEC0101','ANT100Y1 LEC0501']
	'''
	return matched_courses
	

